import React, { useState } from 'react';
import './Home.css';

const HomePage = () => {
  const [email, setEmail] = useState('');
  const [message, setMessage] = useState('');

  const handleFormSubmit = (e) => {
    e.preventDefault();
    alert('Your message has been submitted!');
    setEmail('');
    setMessage('');
  };

  return (
    <div className="homepage">
      <header className="homepage-header">
        <h2 className="title">Welcome to Devs On Deck</h2>

        <div className="search-bar">
          <input type="text" placeholder="Search for jobs or companies..." />
          <button>Search</button>
        </div>
      </header>

      <div className="sections">
        <div className="section">
          <h3>About Us</h3>
          <p>Learn more about the platform and its features.</p>
        </div>
        <div className="section">
          <h3>Our Mission</h3>
          <p>We aim to connect talented developers with top job opportunities.</p>
        </div>
        <div className="section faq-section">
          <h3>FAQ</h3>
          <p>Find answers to frequently asked questions.</p>

          <form onSubmit={handleFormSubmit} className="faq-form">
            <input 
              type="email" 
              value={email} 
              onChange={(e) => setEmail(e.target.value)} 
              placeholder="Enter your email" 
              required 
            />
            <textarea 
              value={message} 
              onChange={(e) => setMessage(e.target.value)} 
              placeholder="Your question or feedback" 
              required 
            />
            <button type="submit">Submit</button>
          </form>
        </div>
      </div>
    </div>
  );
};

export default HomePage;
